import React from "react";
import {
  FaHtml5,
  FaReact,
  FaJava,
  FaPython,
  FaNode,
  FaCss3,
  fadart,
} from "react-icons/fa";
import { MdJavascript } from "react-icons/md";
import { BiLogoFlutter } from "react-icons/bi";
function Skills() {
  return (
    <div>
      <h1>Skills</h1>
      <div className="d-flex flex-row">
        <FaHtml5 />
        <FaJava />
        <FaPython />
        <FaReact />
        <FaNode />
        <FaCss3 />
        <BiLogoFlutter />
        <MdJavascript />
        <span>C#</span>
        <span>SQL</span>
      </div>
    </div>
  );
}

export default Skills;
